  \"2001-ozone-design-value\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\":
  \"Ozone is generated by a complex atmoshperic chemical process. Industrial and automobile
  pollutants in the form of oxides of nitrogen and hydrocarbons react in the atmosphere
  when air is stagnant and temperatures are high to form ozone. Ozone is known to
  cause adverse health effects in humans. See the following websites for more information
  on air quality and data. (http://www.epa.gov/airnow/; http://www.epa.gov/air/; http://www.epa.gov/ttn/;
  http://www.epa.gov/ttn/airs/airsaqs/; http://www.epa.gov/ttn/amtic/; http://www.epa.gov/air/criteria.html).
  More information about these resources, including the variables used in this study,
  may be found here: https://edg.epa.gov/data/Public/ORD/NERL/ReVA/ReVA_Data.zip.\",\n\t\"license_title\":
